__NUXT_JSONP__("/svet/mesto/viden", (function(a,b,c,d){return {data:[{place:[{id:101,id_state:b,name:"Vídeň",population:1911728,area:414.78,altitude:171,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"viden",information_chatgpt:"Vídeň je hlavním městem Rakouska a s více než 1,9 miliony obyvatel největším městem země. Leží na východě Rakouska na řece Dunaji a je významným kulturním, politickým a ekonomickým centrem střední Evropy.\n\nVídeň je známá svou architekturou, zejména barokními a secesními stavbami, a je domovem mnoha významných kulturních institucí, včetně opery, divadel a galerií. Město je také známé svým historickým dědictvím, včetně Hofburgu, bývalého císařského paláce, a Stephansdomu, gotické katedrály.\n\nVídeň je také důležitým centrem v oblasti vzdělání, vědy a výzkumu a má řadu prestižních univerzit a výzkumných institucí. Město je také známé svou kulinářskou scénou, včetně kávových domů, cukráren a restaurací, které nabízejí rakouskou kuchyni a další kuchyně z celého světa.\n\nVídeň je také důležitým dopravním uzlem, s mezinárodním letištěm a řadou dálnic a železničních tratí. Město je také známé svým veřejným dopravním systémem, včetně tramvají, autobusů a metra.",image_cover:c,image_hero:c}],placeState:[{id:b,mpz:"AT",tld:".at",name:"Rakousko",area:83858,population:9006400,slug:"rakousko",id_continent:4,number_cities:a,information_chatgpt:"\u003Cp\u003ERakousko je stát nacházející se ve střední Evropě. Hraničí s Německem na severozápadě, s Českou republikou na severu, se Slovenskem na severovýchodě, s Maďarskem na východě, s Itálií na jihu a s Lichtenštejnskem a Švýcarskem na západě. S rozlohou přibližně 83 878 km² a asi 8,9 miliony obyvatel patří Rakousko mezi menší státy Evropy.\n\u003C\u002Fp\u003E\u003Cp\u003E\nHlavním městem Rakouska je Vídeň a úředním jazykem je němčina. Rakousko je známé pro svou bohatou kulturu a historii, včetně významných osobností, jako byli například Wolfgang Amadeus Mozart, Ludwig van Beethoven, Sigmund Freud a Gustav Klimt. Země je také známá pro své horské scenérie a přírodní krásy, jako jsou Alpy, Dunajský lom a jezera.\n\u003C\u002Fp\u003E\u003Cp\u003E\nRakousko je ekonomicky vyspělá země s vysokou životní úrovní. Je to exportně orientovaná ekonomika, specializující se na automobilový a strojírenský průmysl, turistiku, těžbu surovin a zpracování potravin. Rakousko je také známé pro své gastronomické speciality, jako jsou Wiener schnitzel, Sachertorte a rakouské víno.\n\u003C\u002Fp\u003E\u003Cp\u003E\nRakousko je federální parlamentní republikou, skládající se ze 9 spolkových zemí. Je to člen Evropské unie a OSN.\u003C\u002Fp\u003E",image_cover:d,image_hero:d,currency_code:"EUR",currency_name:"euro",money_prices:[{name:"Levný hotel",price:"40-70 € za noc"},{name:"Normální hotel",price:"70-150 € za noc"},{name:"Dražší hotel",price:"150-300 € za noc"},{name:"Cigarety (Marlboro)",price:"5,50 € za krabičku"},{name:"Pivo (0,5 l)",price:"3-5 €"},{name:"Chléb (1 kg)",price:"1-3 €"},{name:"Jízda taxíkem (1 km)",price:"1-2 €"},{name:"500 ml vody",price:"0,50-1 €"}],phone_numbers_emergency:[{name:"Policie",number:"133"},{name:"Hasiči",number:"122"},{name:"Zdravotnická záchranná služba",number:"144"},{name:"Záchranná služba v horách",number:"140"},{name:"Informační linka pro turisty",number:"0800 240 24"}],phone_prefix:"+43"}],placeContinent:a}],fetch:{},mutations:void 0}}(null,12,"https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fviden.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fstates\u002Frakousko.jpg")));